font-size:15pt;\"><span>一、<span>&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:15pt;\">日用百货，化妆品退换货政策<span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">详细退换货规则如下：</span><span style=\"font-family:宋体;font-size:15pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、化妆品及日用百货类一经签收确认则不可办理退换货。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">2</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、办理退换货时，如订单中有赠品，请您一并退回。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">3</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、礼包或套装中的商品不可以部分退换货，因退货后，原礼包或套装中商品将无法享受购买时的优惠。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">4</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、图片及信息仅供参照，因拍摄灯光及不同显示器色差等问题可能造成商品图片与实物有一定色差，一切以实物为准。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">5</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、包装破损商品、临近有效期商品、清仓甩货商品，不予退换货。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">6</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、 遇过敏问题产生退换货需要提供医院的相关证明。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:-18.9pt;\">\r\n	<a name=\"undefined\"></a><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\"><span>&nbsp;</span><span>&nbsp;&nbsp; </span>7</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、 化妆品及日用百货类产品，一旦拆封非因质量问题不接受退货。商品质量问题需提供第三方权威机构<span>(</span>经国家<span>CMA</span>资质认证）或品牌方出具的检测证明。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">以下情况不予办理退换货：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、任何非由淘五季网出售的商品<span>;</span></span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">2</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、任何因非正常使用及保管导致出现质量问题的商品<span>;</span></span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">3</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、商品的外包装、附件、赠品（券）未能和主商品一起退回</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">4</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、说明书不完整，缺失或涂改<span>;</span></span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">5</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、超过网站承诺退换货周期的商品。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">退换货分类细则：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、化妆及日用产品：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:18.9pt;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">1) </span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">我们保证商品的进货渠道和质量，如果客户在使用时对商品质量表示置疑，请出具书面鉴定，我们会按照国家法律规定予以处理。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:-13.65pt;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">2) </span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">如果您使用后对商品质量表示置疑（例如：过敏、脱皮等），请及时与客服取得联系，并出具相关书面鉴定，我们会根据国家相关规定予以处理。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:18.9pt;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">3) </span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">因化妆品及日用百货类进货批次不同，故同款商品的生产日期不同，网站信息仅供参考，具体以实物为准。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:18.9pt;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">4) </span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">化妆品工具类因个人问题使用不当导致的质量问题不予退还。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">温馨提示：</span><i><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span></i> \r\n</p>\r\n<p style=\"text-indent:18.9pt;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">化妆品的使用效果会因肤质、年龄、季节、气候、使用方法以及配套产品等的不同而效果不一，因此，介绍的功能及使用效果仅供参考，如果您对商品细节有任何疑问，请在订购前与客服联系并详细确认。<span></span></span> \r\n</p>\r\n<p>\r\n	<span><span style=\"font-size:20px;line-height:30px;\">二、内衣、童装退换货政策</span></span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">服装商品的退换货详细说明：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">服装类商品自签收之日起<span>7</span>日内，如遇商品质量问题（除人为、客观外力因素）<span>,</span>可申请退换货。在退换货时，请您保证相关吊牌未拆除，包装以及附件齐全、无污渍破损、未经使用、不影响二次销售并提供商品购买凭证，方可申请办理退换货。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">退换货商品指导：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">面料问题：开裂，面料不牢，拔丝。有洞（做旧设计除外），破裂。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">工艺问题：脱线，缺口，印花不良，裤，袖有短有长，拉链，钮扣及其他配件损坏。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">水洗问题：严重褪色变色（部分商品天然落色，如牛仔），变形。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">特别提示：内衣与泳装类商品不提供试穿服务，商品一经签收无质量问题不提供退换货服务，给您造成的不便望您谅解。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">因其余质量问题退换货具体可咨询淘五季网（023-63821265）。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:宋体;background:white;color:#666666;\"></span> \r\n</p>\r\n<p style=\"text-indent:-36pt;margin-left:36pt;\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:15pt;\"><span>三、<span>&nbsp; </span></span></span><span style=\"font-family:宋体;background:white;color:#666666;font-size:15pt;\">鞋类产品退换政策<span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:red;font-size:9pt;\">请您保证相关吊牌未拆除，包装以及附件齐全，不影响二次销售并提供商品购买凭证，方可申请办理退换货。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:red;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">以下情况不予办理退<span>/</span>换货：</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、包装破损或有明显穿着痕迹（如鞋面褶皱、鞋底磨痕等），保管不当导致的商品磨损及鞋靴装饰掉落，均不予退换货；</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">2</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、赠品、组合销售商品、礼包、套装中的商品已经使用、损坏或未寄回的，不可以部分退货；</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">3</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、商品的相关配件丢失或损坏（附件、说明书、发票等）；</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">4</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、如客户未经淘五季网办理退货申请，直接将商品寄回淘五季网，淘五季网不承担保管、重新发货、退款责任，必要时淘五季网有权处置滞留商品。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#7a1111;\">温馨提示</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#7a1111;\"></span> \r\n</p>\r\n<p style=\"text-indent:-18.9pt;background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\"><span>&nbsp;&nbsp;&nbsp; </span>1</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、退换货时，请您务必将保持完好的品牌包装、鞋盒、内带附件、标签、说明书等，购物凭证、收货快递面单（如有发票或赠品）需同商品一起退回。如寄回商品缺少发货单、收货快递面单或包装破损<span>/</span>丢失，即便在退换货期内，也无法为您办理。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:-18.9pt;background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\"><span>&nbsp;&nbsp;&nbsp; </span>2</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、淘五季网保证所售商品均为正品且无质量问题，如果您在使用时对商品是否为正品存在置疑，请出具专业质量监督检验机构的书面鉴定，淘五季会根据国家规定予以处理。</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"background:white;\">\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">3</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">、请您在</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:red;font-size:9pt;\">签收</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\">商品时，仔细检查商品，如您收到商品与您订购商品不符，商品包装破损变形，请及时联系</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:red;font-size:9pt;\">淘五季网客服人员</span><span style=\"font-family:\'微软雅黑\',\'sans-serif\';color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:宋体;background:white;color:#666666;font-size:15pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-family:\'微软雅黑\',\'sans-serif\';background:white;color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span></span> \r\n</p>','','','质量',1,1,1242577326,'',0,'http://',''),(24,16,'公司简介','&nbsp;\r\n<h1 style=\"text-align:justify;margin-left:0in;\" align=\"center\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公司简介&nbsp;&nbsp;&nbsp;</span></span> \r\n</h1>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\">&nbsp;&nbsp; 季吉氏家是一家做全球化一站式</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">B2B</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">的供货平台，为万千实体店提供优质、快捷、高效的采购（用户）体验。</span><span style=\"font-family:微软雅黑;color:#595959;font-size:16pt;\"> </span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:16pt;\"><span style=\"font-family:SimSun;font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:SimSun;font-size:14px;\">公司的产品覆盖率，将达到全球</span></span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">160多个</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">国家，我们以去除传统流通领域的中间成本为主要手段，以大数据和元计算为依托，建立从厂商到零售终端的一站式采购平台，利用互联网平台整合厂商和终端资源，强化构建软件服务生态，</span><span style=\"font-family:微软雅黑;color:#595959;font-size:16pt;\"> </span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">服务于万千中小实体店，让您足不出户就可享受全球资源最大化。</span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\"></span><span style=\"font-family:微软雅黑;color:#595959;font-size:16pt;\">&nbsp;</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">公司成立于</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">2014</span><span style=\"font-family:SimSun;color:#595959;font-size:14px;\">年，在香港九龙组注册，以日化产品为延伸，进入内陆重庆。未来将在香港和内陆两地上市，成为顶尖的互联网公司。&nbsp;&nbsp; </span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\">&nbsp;&nbsp;&nbsp; 企业使命：打造全球最大的B2B实体店采购平台</span>\r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:16pt;\"></span><span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"><span style=\"font-family:SimSun;font-size:14px;\">&nbsp;&nbsp;&nbsp; 企业愿景：做百年季吉世家国家、企业、客户、员工利益共享</span></span><span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"> </span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\">&nbsp;&nbsp;&nbsp; 企业目标：打造百万个百万富翁。</span><span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\">&nbsp;</span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\">&nbsp;&nbsp; 企业风貌：拓展资源整合平台，自建仓配一体化物流中心，塑造家庭式氛围经营团队，实现多、快、好、省得采购体验。</span><span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"> </span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"></span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:SimSun;color:#595959;font-size:14px;\">&nbsp;</span> \r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span style=\"font-family:微软雅黑;color:#595959;font-size:14.7pt;\"></span> \r\n</p>\r\n&nbsp;\r\n<p>\r\n	<br />\r\n</p>','','','',0,1,1242577432,'',0,'http://',''),(25,16,'联系我们','<p>\r\n	名称：重庆季吉世家网络科技有限公司\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	地址：重庆市南岸区茶园新区玉马路18号\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	客服电话：023-68813252\r\n</p>','','','',0,1,1242577448,'',0,'http://',''),(26,16,'投诉与建议 ','','','','',0,0,1242577459,'',0,'http://',''),(36,5,'隐私声明','<p>&nbsp;<b style=\"font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif; line-height: 24px; margin: 0px; padding: 0px; font-size: 14px; color: rgb(33, 33, 33);\">隐私政策</b></p>\r\n<div class=\"content_list border_none list_top_txt\" style=\"margin: 0px; padding: 25px 0px 15px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">米奇网以此声明对本站用户隐私保护的许诺。随着本站服务范围的扩大，会随时更新隐私声明。我们欢迎您随时查看隐私声明。</p>\r\n</div>\r\n<div class=\"content_list border_none\" style=\"margin: 0px; padding: 15px 0px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">\r\n<p style=\"margin: 